import React from 'react';
import ReactDOM from 'react-dom';

ReactDOM.render(
  <App />,
  document.getElementById('root')
);
function App() {
  return <main>
    <randomColor>Hello word</randomColor>
  </main>;
}
function randomColor(props){
  let ranColor = '#'+Math.floor(Math.random()*16777215).toString(16);;
  return <h1 style={{color: ranColor}} >{props.children}</h1>;
}
function ItalicText(props) {
  return <i style={{color: props.color}}>
    {props.children}
  </i>;
}
